export const GRID_POSITION = 0;
export const VERTICAL_POSITION = 1;

const defaultState = {
    state: GRID_POSITION
}

export const positionReduser = (state = defaultState, action) => {
    switch (action.type) {
        case "CHANGE_POSITION":
          return {...state, position: 0 + action.payload}
        case "SET_COUNT":
          return {...state, position: 0 + action.payload};
        default:
          return state;
    }
}
